    <div>
    <div className = "MenuBar">
      <button class = "Menucontents" id = "kangwonNow">지금의 강원</button> 
      
      <div class = "Menucontents"  id = "TripPlace">여행지</div>
      <div class = "Menucontents" id = "TripInfo">여행정보</div>
      <div class = "Menucontents" id = "Reserv">예약하기</div>
      
    </div>
    <div id = "hoverMenu">
        

      </div>
    </div>
  );
}

export default headerMenu;
